import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom"; // Cambiado de useHistory a useNavigate

function Home() {
  const navigate = useNavigate(); // useNavigate en lugar de useHistory

  // Verifica si el token está en localStorage
  useEffect(() => {
    const token = localStorage.getItem("token");

    if (!token) {
      // Si no hay token, redirige al login
      navigate("/signin"); // Usamos navigate para redirigir
    }
  }, [navigate]); // Añadido navigate a las dependencias

  return (
    <div>
      <h1>SPS REACT TEST</h1>
      <a href="/users">Usuários</a>
    </div>
  );
}

export default Home;
